import {Bar} from 'react-chartjs-2'
import { Link } from "react-router-dom";


var count = 1;
var d1 = [1, 2, 3];

export default function DrawGraph(data1) {

    // const [data, setData] = useState([{}])

    console.log(d1)
    console.log(count)
    return (
        <div className='bar-chart'>
            <Bar
            data = {{
                labels:data1.members,
                datasets: [{
                    label: '# of votesk',
                    data: d1,
                }

                ]
            }}
            height={400}
            width={600}
            />

        <div className={`button`}>
            <button value="/default_data_set" onClick={reload}>Big Button</button>
        </div>

        </div>



        )


}

function reload(e) {
    console.log("button pressed")
    count += 1;


    fetch(e).then(
        res => res.json()
    ).then(

        data => {
            d1 = data
        }
    )
    // console.log(d1)
    DrawGraph(d1)
}

